import sys
import math

# <h1>Introduction</h1>
# <p>The code in this project is based on <em>The Descent</em> at Coding Games
#     found <a href="https://www.codingame.com/ide/puzzle/the-descent">here.</a>
# </p>
# <p>This section is a brief introduction to how the code works. The
#     <strong>while loop</strong> represents the game. Each iteration represents
#     a turn of the game where you are given inputs (the heights of the
#     mountains) and where you have to print an output (the <strong>index of the
#         mountain to fire on</strong>) The inputs you are given are
#     automatically updated according to your last actions. See the below image
#     of a block diagram that represents the flow of the game.</p>
# <p>If trying to put this code back into coding game and you get <span
#         style="color: rgb(224, 62, 45);">Error! Code to big!</span> Remove the
#     image below.</p>
# <p><img src="data:image/jpeg;base64,"
#         width="287" height="413"></p>


# <h2>Game Loop</h2>
while True:

    # <p>The<strong> max_h</strong> and <strong>i_val</strong> variables are
    #     placeholder variables. These values get updated as the while loop
    #     progresses. There are 8 mountains the ship has to destroy, and the for
    #     loop has an index that accounts for this. The current mountain height
    #     is stored as the <strong>mountain_h</strong> variable and is then
    #     checked against the current max height. If it stays the max height, it
    #     is then passed to the print statement for the ship to target and
    #     destroy that mountain.&nbsp;</p>
    max_h = 0 # maximum height per pass
    i_val = 0 # index value of mountain

    # <p>get all mountain heights per pass of ship</p>
    for i in range(8):
        mountain_h = int(input())  # represents the height of one mountain.

        # <p>if statement to check if each mountain is tallest</p>
        if mountain_h > max_h:
            max_h = mountain_h # store max height
            i_val = i # store index

    # <p>Write an action using print To debug: print("Debug messages...",
    #     file=sys.stderr, flush=True)</p>

    # <h3>Output</h3>
    # <p>The index of the mountain to fire on.</p>
    print(i_val)
    
    
